import React from "react";
import { NavLink } from "react-router-dom";

const Navbar=()=>{

    return(
        <>
        <NavLink to={"/"}>About</NavLink>
        <NavLink to={"/contact"}>About</NavLink>
        <br/>
        <a href="/">About</a>
        <a href="/contact">Contact</a>
        </>
    )

}
export default Navbar;
